import  React, { Component } from  'react';
import  PostService  from  './PostService';

const  postService  =  new  PostService();

class  PostList  extends  Component {

constructor(props) {
    super(props);
    this.state  = {
        posts: [],
    };
}

componentDidMount() {
    var  self  =  this;
    const postService = new PostService();
    postService.getPosts().then(function (result) {
        console.log(result);
        self.setState({ posts:  result.data})
    });
}
render() {

  return (
         <div  className="customers--list">
             <table  className="table">
             <thead  key="thead">
             <tr>
                 <th>#</th>
                 <th>First Name</th>
                 <th>Last Name</th>
                 <th>Phone</th>
                 <th>Email</th>
                 <th>Address</th>
                 <th>Description</th>
                 <th>Actions</th>
             </tr>
             </thead>
             <tbody>
             {this.state.posts.map( c  =>
                 <tr >
                 <td>{c.Name}  </td>
                 <td>{c.time}  </td>
                 <td>{c.Description}  </td>
                 <td>{c.Author}  </td>

             </tr>)}
             </tbody>
             </table>
         </div>
         );
  }
}
export  default  PostList;
